import 'bootstrap/dist/css/bootstrap.min.css';
import Login from './components/Auth/Login';
import SignUp from './components/Auth/Signup';
import './App.css';

function App() {
 

  return (
    <div className="App">
    <Login />
    <SignUp />
  </div>
  );
}

export default App;
